mapper.select:
       select top 1 

      from TPAY_CSYS_TXN_LOG
      where 1=1

        and ori_org_id = #{params.oriOrgId}


        and ori_opr_trans_id = #{params.oriOprTransId}


        and ori_req_date = #{params.oriReqDate}


        and order_id = #{params.orderId}


        and status = #{params.status}


      and req_trans_dt = #{params.reqTransDt}


      and req_domain = #{params.reqDomain,jdbcType=CHAR}


      and settle_date = #{params.settleDate}


      and  req_session_id = #{params.reqSessionId,jdbcType=VARCHAR}


      and  req_trans_id = #{params.reqTransId,jdbcType=VARCHAR}


      and  req_opr_id = #{params.reqOprId,jdbcType=VARCHAR}


      and  back_url = #{params.backUrl,jdbcType=VARCHAR}


      and  server_url = #{params.serverUrl,jdbcType=VARCHAR}


      and  buss_chl = #{params.bussChl}


      and l_seq_id =  #{params.lSeqId}



       and req_trans_tm = #{params.reqTransTm}


       and req_cnl_type = #{params.reqCnlType}



       and mer_id = #{params.merId}

	   order by last_upd_time desc
